CREATE EXTENSION IF NOT EXISTS "uuid-ossp";

SELECT uuid_generate_v4();

CREATE OR REPLACE FUNCTION usuariosID()
RETURNS trigger
LANGUAGE 'plpgsql'
AS $$
BEGIN
NEW.id := uuid_generate_v4();
RETURN NEW;
END;
$$;

CREATE TRIGGER insert_usuariosID
BEFORE INSERT ON usuarios
FOR EACH ROW EXECUTE PROCEDURE usuariosID();

